import React, { useEffect, useState } from "react";
import * as API from "../../utils/api";

const Index = () => {
  const [todos, setTodos] = useState([]);

  useEffect(() => {
    API.getTodos()
      .then((response) => {
        setTodos(response.data);
      })
      .catch(function (error) {
        console.log(error);
      });
  }, []);

  return (
    <>
      <table>
        <thead>
          <tr>
            <th>Id</th>
            <th>Title</th>
          </tr>
        </thead>
        <tbody>
          {todos.map((todo) => (
            <tr key={todo.id}>
              <td>{todo.id}</td>
              <td>{todo.title}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
};

export default Index;
